import request from '@/utils/request'

export function getAssetList(params) {
  return request({
    url: '/api/assets/',
    method: 'get',
    params
  })
}

export function getAssetStatistics() {
  return request({
    url: '/api/assets/statistics/',
    method: 'get'
  })
}
